import React, { useState, setState } from "react";
import "./WrapperBack.css";
import Card from "./Card";
import Bottom from "./Bottom";
import data from "../data.json";
import {
  FaCaretDown,
  FaCaretUp,
  FaCaretLeft,
  FaCaretRight,
} from "react-icons/fa";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";

const wstyles = {
  height: "100vh",
  width: "100vw",
  position: "absolute",

  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  overflow: "hidden",
  flexDirection: "column",
};

const cstyles = {
  height: "100%",
  width: "100%",
  position: "relative",
};

const WrapperBack = () => {
  return (
    <TransformWrapper>
      <TransformComponent wrapperStyle={wstyles} contentStyle={cstyles}>
        <div className="shoe">
          <img className="pic" src={`./shoes/1.jpg`} />
        </div>
      </TransformComponent>
    </TransformWrapper>
  );
};

export default WrapperBack;

